import React from 'react'
import AllData from './Musicdata.json';

const Music = () => {
  const data=[];
  return (
    <div className='music'>
      <div className="container">
        <div className="btns">
          <button>All items</button>
          <button
          onClick={()=>{
            AllData.filter((val,i)=>{
              if(val.music_name==="Music Art Super Item"){
                data[i]=val;
              }
            })
            console.log(data);
          }
          }
          >Music Art</button>
          <button>Digital Art</button>
          <button> Block Art</button>
          <button>Blockchain</button>
          <button>Virtual</button>
        </div>
        <h1 style={{color:'white'}}>items currently in the market</h1>
        <div className="row text-light">
          {
            data.map((Data)=>{
              return(<div className='text-light'><p style={{color:'white'}}>{Data.money}</p></div>)
            })
            
          }
        </div>
      </div>
    </div>
  )
}

export default Music
